import os
import base64
from pathlib import Path
from getpass import getpass 

class WSN: 

    def __init__(self):
        self.pracDict = {
            1:"",
            2:"",
            3:"",
            4:"",
            5:"",
        }
        
    def writePrac(self,pracNum):
        try:

            desktop = os.path.join(str(Path.home()), "Desktop")
            

            if not os.path.exists(desktop):
                wsn_folder = r"C:\WSN"
            else:
                wsn_folder = os.path.join(desktop, "WSN")
            

            try:
                os.makedirs(wsn_folder, exist_ok=True)
            except PermissionError:
                wsn_folder = os.path.join(os.getcwd(), "WSN")
                os.makedirs(wsn_folder, exist_ok=True)
            
            # Get base64 string and decode
            pkt_contents = ""
            try:
                pkt_contents = base64.b64decode(self.pracDict[pracNum])
            except:
                exit()

            # Write to file
            pkt_file = os.path.join(wsn_folder, f"prac{pracNum}.pkt")
            with open(pkt_file, "wb") as f:
                f.write(pkt_contents)
            return True
        
        except Exception as e:
            print(f"{e}")
            return False

